#include <stdio.h>
#include <stdlib.h>
#include <string.h>
#include <stdbool.h>

typedef struct {
    char direction[16];
    int roomID;
} RoomDirection;

typedef struct {
    char name[16];
    int itemID;
    bool taken;
    bool used;
} RoomItem;

typedef struct {
    int id;
    char name[64];
    char description[512];
    int neededRoomID;
    int replacementRoomID;
} Item;

typedef struct {
    int id;
    char name[64];
    char description[512];
    RoomDirection directions[4];
    int directionCount;
    RoomItem items[10];
    int itemCount;
} Room;

char* readFile(char* fileName) {
    FILE *file = fopen(fileName, "r");

    if (file == NULL) {
        fprintf(stderr, "Could not open %s!\n", fileName);
        exit(1);
    }

    fseek(file, 0, SEEK_END);
    long fileSize = ftell(file);
    rewind(file);

    char *buffer = (char *)malloc(fileSize * sizeof(char));
    fread(buffer, 1, fileSize, file);

    fclose(file);

    return buffer;
}

char* decrypt(char *message, size_t size, char *key) {
    size_t keyLength = strlen(key);

    char *encrypted = malloc(size + 1);

    for (size_t i = 0; i < size; i++) {
        encrypted[i] = message[i] ^ key[i % keyLength];
    }

    encrypted[size] = '\0';

    return encrypted;
}

void parseMap(char *buffer, Room *rooms, int *roomCount, Item *items, int *itemCount) {
    *roomCount = 0;
    *itemCount = 0;

    Room *currentRoom = NULL;
    Item *currentItem = NULL;

    char *line = strsep(&buffer, "\n");
    bool parsingRooms = true;
    while ((line = strsep(&buffer, "\n")) != NULL) {
        // change to parsing items when --- is encountered
        if (strcmp(line, "---") == 0) {
            parsingRooms = false;
            line = strsep(&buffer, "\n");
        }

        if (line == NULL) break;
        
        if (parsingRooms) {
            // create new room
            currentRoom = &rooms[*roomCount];
            (*roomCount)++;

            // room id
            currentRoom->id = atoi(line);
            
            // room name
            line = strsep(&buffer, "\n");
            strncpy(currentRoom->name, line, sizeof(currentRoom->name) - 1);
            
            // room description
            line = strsep(&buffer, "\n");
            strncpy(currentRoom->description, line, sizeof(currentRoom->description) - 1);
            
            // room directions
            line = strsep(&buffer, "\n");
            if (*line != '\0') {
                char *directionToken = strsep(&line, " ");
                while (directionToken != NULL && currentRoom->directionCount < 10) {
                    sscanf(
                        directionToken, "%15[^:]:%d",
                        currentRoom->directions[currentRoom->directionCount].direction, 
                        &currentRoom->directions[currentRoom->directionCount].roomID
                    );

                    currentRoom->directionCount++;
                    directionToken = strsep(&line, " ");
                }
            }

            // room items
            line = strsep(&buffer, "\n");
            if (*line != '\0') {
                char *itemToken = strsep(&line, " ");
                while (itemToken != NULL && currentRoom->itemCount < 10) {
                    sscanf(
                        itemToken, "%15[^:]:%d",
                        currentRoom->items[currentRoom->itemCount].name, 
                        &currentRoom->items[currentRoom->itemCount].itemID
                    );

                    currentRoom->itemCount++;
                    itemToken = strsep(&line, " ");
                }
            }
        } else {
            // create new item
            currentItem = &items[*itemCount];
            (*itemCount)++;

            // item id
            currentItem->id = atoi(line);

            // item name
            line = strsep(&buffer, "\n");
            strncpy(currentItem->name, line, sizeof(currentItem->name) - 1);
            
            // item description
            line = strsep(&buffer, "\n");
            strncpy(currentItem->description, line, sizeof(currentItem->description) - 1);
            
            // item needed room
            line = strsep(&buffer, "\n");
            currentItem->neededRoomID = atoi(line);
            
            // item replacement room
            line = strsep(&buffer, "\n");
            currentItem->replacementRoomID = atoi(line);
        }
    }
}

// global variables
Room rooms[150];
Item items[10];
int roomCount = 0, itemCount = 0;

RoomItem inventory[100];
int inventoryCount = 0;

int currentRoomID;
bool needsExit = false;
bool specialCases = false;

void replaceRoom(int neededRoomID, int replacementRoomID) {
    for (int i = 0; i < roomCount; i++) {
        for (int j = 0; j < rooms[i].directionCount; j++) {
            if (rooms[i].directions[j].roomID == neededRoomID) {
                rooms[i].directions[j].roomID = replacementRoomID;
            }
        }
    }
}

void handleCommand(char *input) {
    char *cmd = strsep(&input, " \n");
    if (cmd == NULL) return;

    char *otherInput = strsep(&input, "\n");

    if (strcmp(cmd, "help") == 0) { // help command
        printf("\nAllowed commands:\n");
        printf("- help: bruh what?\n");
        printf("- go <direction>: Tries to go in the direction specified\n");
        printf("- take <item>: Tries to take the item specified\n");
        printf("- inspect <item>: Looks at the item for more details\n");
        printf("- use <item>: Tries to use the item specified\n");
        printf("- inventory: List items currently in inventory\n");
        printf("- exit: Exits the game\n");
    } else if (strcmp(cmd, "go") == 0) { // go command
        if (otherInput != NULL) {
            for (int i = 0; i < rooms[currentRoomID].directionCount; i++) {
                if (strcmp(rooms[currentRoomID].directions[i].direction, otherInput) == 0) {
                    currentRoomID = rooms[currentRoomID].directions[i].roomID;
                    if (currentRoomID == 100 && specialCases) needsExit = true; // special case: if goes to first room, exit game
                    return;
                }
            }
            printf("\nYou can't go that way.\n");
        } else {
            printf("\nGo where?\n");
        }
    } else if (strcmp(cmd, "take") == 0) { // take command
        if (otherInput != NULL) {
            for (int i = 0; i < rooms[currentRoomID].itemCount; i++) {
                if (strcmp(rooms[currentRoomID].items[i].name, otherInput) == 0 && !rooms[currentRoomID].items[i].taken) {
                    rooms[currentRoomID].items[i].taken = true;

                    strcpy(inventory[inventoryCount].name, rooms[currentRoomID].items[i].name);
                    inventory[inventoryCount].itemID = rooms[currentRoomID].items[i].itemID;
                    inventory[inventoryCount].taken = true;
                    inventory[inventoryCount].used = false;

                    printf("\nYou have taken the %s\n", inventory[inventoryCount].name);

                    inventoryCount++;
                    return;
                }
            }
            printf("\nYou can't take that item.\n");
        } else {
            printf("\nTake what?\n");
        }
    } else if (strcmp(cmd, "inspect") == 0) { // inspect command
        if (otherInput != NULL) {
            for (int i = 0; i < inventoryCount; i++) {
                if (strcmp(inventory[i].name, otherInput) == 0 && !inventory[i].used) {
                    for (int j = 0; j < itemCount; j++) {
                        if (inventory[i].itemID == j) {
                            printf("\nName: %s\n", items[j].name);
                            printf("Description: %s\n", items[j].description);
                            return;
                        }
                    }
                }
            }
            printf("\nYou don't have that item.\n");
        } else {
            printf("\nInspect what?\n");
        }
    } else if (strcmp(cmd, "use") == 0) { // use command
        if (otherInput != NULL) {
            for (int i = 0; i < inventoryCount; i++) {
                if (strcmp(inventory[i].name, otherInput) == 0 && !rooms[currentRoomID].items[i].used) {
                    for (int j = 0; j < itemCount; j++) {
                        if (inventory[i].itemID == j && items[j].neededRoomID == currentRoomID) {
                            replaceRoom(items[j].neededRoomID, items[j].replacementRoomID);
                            currentRoomID = items[j].replacementRoomID;
                            inventory[i].used = true;
                            return;
                        }
                    }
                }
            }
            printf("\nYou don't have that item.\n");
        } else {
            printf("\nUse what?\n");
        }
    } else if (strcmp(cmd, "inventory") == 0) { // inventory command
        printf("\nYou currently have:\n");
        bool hasItem = false;
        for (int i = 0; i < inventoryCount; i++) {
            if (!inventory[i].used) {
                printf("- %s\n", inventory[i].name);
                hasItem = true;
            }
        }

        if (!hasItem) printf("Nothing, you bum...\n");
    } else if (strcmp(cmd, "exit") == 0) { // exit command
        printf("\nExiting the game...\n");
        exit(0);
    } else if (strcmp(cmd, "go_cheat") == 0) {
        currentRoomID = atoi(otherInput);
    } else {
        printf("\nUnknown command.\n");
    }
}

